import './App.css';
import styled from 'styled-components';

const SearchBar = styled.input`
  margin: auto;
  width: 35%;
  height: 60%;
  background-color: white;
  position: absolute:
  top: 40%;
  padding-left: 20px;
  min-width: 200px;
  border: 0;
`;

const SearchButton = styled.button`
  margin: auto;
  width: 10%;
  height: 60%;
  background-color: pink;
  position: absolute:
  top: 40%;
  padding-left: 10px;
  border: 0;
  min-width: 50px;
  display: block;
`;

function App() {
  return (
    <div className="bg-image">
      <div className="flex-container">
        <SearchBar placeholder="Search By College Or City">

        </SearchBar>
        <SearchButton
          onClick={() => {

          }
          }
        >
        <i class="fas fa-search"></i> 
          Search
        </SearchButton>
      </div>
    </div>
  );
}

export default App;
